import React from "react";

const Leaguetable = ({ data }) => {
  console.log(data);
  return (
    <>
      <div className="w-full h-full text-black flex">
        {data.map((item) => {
          <div className="flex  w-full h-[60px] justify-between">
            <h1>{Data.Position}</h1>
            <h1>{Data.Name}</h1>
            <h1>{Data.Played}</h1>
            <h1>{Data.Loosed}</h1>
            <h1>Drwn</h1>
            <h1>lost</h1>
            <h1>GF</h1>
            <h1>GA</h1>
            <h1>GD</h1>
            <h1>Pnts</h1>
          </div>;
        })}
      </div>
    </>
  );
};

export default Leaguetable;
